const App = () => {
    return (
        <WebSocketProvider>
            <Routes>
                <Route path="/" element={<PokerComponent />} />
                <Route path="/play/:tableId" element={<Playboard />} />
            </Routes>
        </WebSocketProvider>
    );
};

export default App;
